import React from 'react';

// import { getImageUrl } from './component/user';
function Avatar(person , size){
    return(
        <img
        className="avatar"
      src={getImageUrl(person)}
        alt={person.name}
        width={size}
        height={size}
        />
    );
}

export default function Profile(){
    return(
        <div>
        <Avatar 
        size = {100}
        person = {{
